con:config.script:
def sku = context.expand('${Properties#sku}' )
// Print the sku value 
log.info "sku is $sku"
// If user is not ExpertzMe, the next step to execute should be logout service
if(sku != null){
    log.info "SKU found in list"

    testRunner.gotoStepByName("Create a new product")   
}
else{
log.info "SKU not found"
}

con:configuration.scriptText:
// Get the sku value from the list of products
import com.eviware.soapui.support.XmlHolder
def holder = new XmlHolder(messageExchange.responseContentAsXml)
def sku = holder.getNodeValue('//*:sku[contains(text(),"SKU000212")]')
context.testCase.setPropertyValue("SKUVALUE",sku)

con:config.script:
def sku = context.expand('${Product Get List#Response#//*:sku[contains(text(),"SKU00010")]}' )
// Print the sku value 
log.info "sku is $sku"
// If user is not ExpertzMe, the next step to execute should be logout service
if(sku != null){
    log.info "SKU found in list"

    testRunner.gotoStepByName("Get Product by SKU Groovy Script")   
}
else{
log.info "SKU not found"
}

